import React from "react";

function Booktoggler(props) {

    if (props.isLoggedIn) {
         const element = <h1 onClick={this.handleViewSearchClick}>View Search Button</h1>;
    } else {
        const element = <h1 onClick={this.handleViewSavedClick}>View Saved Button</h1>;
    }

    ReactDOM.render(
        element,
        document.getElementById('root')
    );
}

export default Booktoggler;
